import './Addnote.css'
function Note(props){
    return(
        <div className={props.classname}>
            <form action="/" method="GET">
                <input type="text" placeholder="Enter task"/>
                <button type="submit" onClick = {props.onclick}>Add Note</button>
            </form>
        </div>
    )
}

export default Note;
